import React from 'react';
import { loadStripe } from '@stripe/stripe-js';
import { Elements } from '@stripe/react-stripe-js';
import SubscriptionCard from '../components/SubscriptionCard';

const stripePromise = loadStripe('your_stripe_publishable_key'); // Replace with your Stripe publishable key

const Subscribe: React.FC = () => {
  const monthlyFeatures = [
    "Ability to choose the body parts you want to work on and get Pulse to create your workout.",
    "Tap into our vibrant fitness community and inspire others with your workout videos.",
    "See the history of your workouts to keep track of weight and progress on each lift."
  ];

  const yearlyFeatures = [
    "Ability to choose the body parts you want to work on and get Pulse to create your workout.",
    "Tap into our vibrant fitness community and inspire others with your workout videos.",
    "See the history of your workouts to keep track of weight and progress on each lift."
  ];

  const handleSubscription = async (priceId: string) => {
    // Send a request to the server to create a checkout session
    const response = await fetch('/create-checkout-session', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ priceId }),
    });
    const session = await response.json();

    // Load the Stripe instance
    const stripe = await stripePromise;

    // Ensure that `stripe` is not `null`
    if (stripe) {
      const { error } = await stripe.redirectToCheckout({ sessionId: session.id });
      if (error) {
        console.error('Stripe checkout error:', error.message);
      }
    } else {
      console.error('Stripe instance could not be initialized.');
    }
  };  

  const openPaymentLink = (url: string) => {
    window.open(url, '_blank');
  };

  return (
    <div className="px-4 sm:px-8">
      <div className="mb-48 bg-white">
        {/* Title Section */}
        <div className="max-w-[1052.76px] mx-auto text-center my-10 mb-64 mt-20">
          <div>
            <span className="text-black text-[76px] sm:text-[76px] font-normal font-['Thunder'] leading-[60px] sm:leading-[107.08px] tracking-wide">Become a member of the collective</span>
          </div>
          <div>
            <span className="text-black text-[46px] sm:text-[46px] font-normal font-['Thunder'] leading-[60px] sm:leading-[107.08px] tracking-wide">The first month is on us!</span>
          </div>
        </div>

        {/* Subscription Cards */}
        <div className="flex flex-col sm:flex-row justify-center items-center gap-8 mb-64">
          <SubscriptionCard
            price="$4.99"
            period="mo"
            description="Flexible, in case you decide to go it alone after a month."
            features={monthlyFeatures}
            titleColor="text-black"
            textColor="text-black"
            backgroundColor="bg-neutral-100"
            actionBgColor="bg-neutral-800"
            actionTextColor="text-white"
            onActionClick={() => openPaymentLink('https://buy.stripe.com/9AQaFieX9bv26fSfYY')}
          />

          <SubscriptionCard
            price="$49.99"
            period="yr"
            description="Flexible, in case you decide to go it alone after a month."
            features={yearlyFeatures}
            titleColor="text-[#E0FE10]"
            textColor="text-white"
            backgroundColor="bg-neutral-800"
            actionBgColor="bg-[#E0FE10]"
            actionTextColor="text-zinc-800"
            onActionClick={() => openPaymentLink('https://buy.stripe.com/9AQaFieX9bv26fSfYY')}
          />
        </div>

        {/* App Features Section */}
        <div className="flex flex-col gap-8 mt-16 items-center justify-center mb-64">
          {/* Grid for App Features */}
          <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-8">
            {/* First Feature */}
            <div className="flex flex-col gap-2">
              <div className="w-5 h-5"></div>
               {/* Feature Image Placeholder */}
              <div className="w-[405px] h-[273.87px] bg-gray-50"></div>
              <div className="text-black text-[22.5px] font-bold font-['HK Grotesk'] leading-loose">Lorem ipsum Lorem ipsum</div>
              <div className="w-[319px] text-neutral-600 text-base font-normal font-['HK Grotesk'] leading-tight">Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem</div>
            </div>

            {/* Second Feature */}
            <div className="flex flex-col gap-2">
              <div className="w-5 h-5"></div>
               {/* Feature Image Placeholder */}
              <div className="w-[405px] h-[273.87px] bg-gray-50"></div>
              <div className="text-black text-[22.5px] font-bold font-['HK Grotesk'] leading-loose">Lorem ipsum Lorem ipsum</div>
              <div className="w-[319px] text-neutral-600 text-base font-normal font-['HK Grotesk'] leading-tight">Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem</div>
            </div>

            {/* Third Feature */}
            <div className="flex flex-col gap-2">
              <div className="w-5 h-5"></div>
               {/* Feature Image Placeholder */}
              <div className="w-[405px] h-[273.87px] bg-gray-50"></div>
              <div className="text-black text-[22.5px] font-bold font-['HK Grotesk'] leading-loose">Lorem ipsum Lorem ipsum</div>
              <div className="w-[319px] text-neutral-600 text-base font-normal font-['HK Grotesk'] leading-tight">Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem</div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Subscribe;
